"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?7/62/8163?source=see_link\">",
"       Patient information: What to expect in the NICU (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?2/38/2659?source=see_link\">",
"       Patient information: When a baby is born premature (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?1/44/1732?source=see_link\">",
