"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?6/55/7034?source=related_link\">",
"      Initial treatment of chronic myeloid leukemia in chronic phase",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?30/49/31512?source=related_link\">",
"      Molecular genetics of chronic myeloid leukemia",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?40/16/41225?source=related_link\">",
"      Overview of the treatment of chronic myeloid leukemia",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_patient\" href=\"UTD.htm?36/60/37829?source=related_link\">",
"      Patient information: Chronic myeloid leukemia (CML) in adults (Beyond the Basics)",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?7/40/7816?source=related_link\">",
"      Treatment of chronic myeloid leukemia in blast crisis",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"UTD.htm?20/17/20762?source=related_link\">",
