var title_f27_20_27979="Pitfalls Dx seafood allergy";
var content_f27_20_27979=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ALLRG%2F65968&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ALLRG%2F65968&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Diagnostic considerations when evaluating fish and shellfish allergy",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Concern",
"      </td>",
"      <td class=\"subtitle1\">",
"       Implication/approach",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Clinical cross-reactivity",
"      </td>",
"      <td>",
"       The rate of serologic (positive test) cross reactivity exceeds the rate of true clinical reactivity, but both are high in seafood allergy.  Therefore, caution is needed (evaluations with tests for IgE and possibly oral food challenges).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Overlap of symptoms with non-allergic seafood reactions",
"      </td>",
"      <td>",
"       Spoilage of seafood most typically results in gastrointestinal reactions that are not consistent and do not mimic allergy (differentiated by history).  However, spoilage of dark meat fish (scombroid poisoning) could result in symptoms that mimic allergy (pruritus, flushing).",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Reactions may vary",
"      </td>",
"      <td>",
"       Inconsistencies in reactions to fish could be attributable to manner of cooking or to which parts of the fish are eaten. Reduced digestion of fish protein is also a variable that could be altered if a patient takes antacid medication.   These points should be examined in the history and considered during allergy testing.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Reactions may be attributed to seafood, but caused by other allergens",
"      </td>",
"      <td>",
"       If a reaction occurs during a meal, ingredients must be reviewed to determine other causes (spices, etc).  Other fish-related foods (caviar) or contaminants (parasites such as anisakis) could be causal",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
