" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Langerhans cell histiocytosis of bone",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 293px; height: 358px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Sagittal T1 weighted&nbsp;magnetic resonance imaging&nbsp;of the upper spine shows a severe flattening of the C6 vertebral body with preservation of adjacent intervertebral discs (vertebra plana deformity, short red arrow). In addition, a soft tissue mass extending into the paracervical region (short yellow arrow) with resulting spinal cord compression (long red arrow) can be identified.",
